import React from 'react';
import { Outlet } from 'react-router-dom'; // For rendering nested routes

const AdminLayout = () => {
    return (
        <div>
            <h1>Admin Panel</h1>
            {/* Sidebar or Navigation Links */}
            <nav>
                <ul>
                    <li><a href="/admin/artists">Manage Artists</a></li>
                    <li><a href="/admin/add-artist">Add Artist</a></li>
                </ul>
            </nav>

            {/* Render the nested route content */}
            <Outlet />
        </div>
    );
};

export default AdminLayout;
